import {Link} from 'react-router-dom';

function Navbar()
{
    return(
        <>
        <Link to='/'>HOME</Link>
        <Link to='/About'>About</Link>
        <Link to='/ContactUs'>Contact us</Link> 
        </>

    )
}
export default Navbar;
